import React, { Component } from "react";
import {
  Switch,
  BrowserRouter,
  Route,
} from "react-router-dom";
import Menu from "./Component/Menu";
import Home from "./Pages/Home";
import Gozareshat from "./Pages/Gozareshat";
import Setting from "./Pages/Setting";
import NotFound from "./Pages/NotFound";
import TowerDetail from "./Pages/TowerDetail";
import SearchResult from "./Pages/SearchResult";
import ElectricityBill from "./Pages/ElectricityBill";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <section className="rtl container-fluid h-100">
          <div className="row h-100">
            <Menu />
            <Switch>

              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/Home/:id">
                <TowerDetail />
              </Route>

              <Route exact path="/Gozareshat">
                <Gozareshat/>
              </Route>


              <Route path="/Gozareshat/search/:id">
                <SearchResult />
              </Route>

              <Route path="/Gozareshat/water/:id">
                <WaterBill />
              </Route>

              <Route path="/Gozareshat/gas/:id">
                <GasBill />
              </Route>

              <Route path="/Gozareshat/electricity/:id">
                <ElectricityBill />
              </Route>


              <Route path="/Setting">
                <Setting />
              </Route>

              <Route exact path="/Home">
                <Home />
              </Route>

              <Route path="*">
                <NotFound />
              </Route>
            </Switch>
          </div>
        </section>
      </BrowserRouter>
    );
  }
}

export default App;
